INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("お！\nあそこに困ってそうな人発見！", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 1.4, "春咲 ひより", 0, 0, 0, 0, 1, 0, 2, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1001, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("大切な人を\n守れるようになりたい…って", "みんなみたいに\nわたしも強くならなきゃ", 1, 1.4, "草野 優衣", 0, 0, 0, 0, 1, 0, 2, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1002, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("キミに必要な集中力と感性が", "フェンシングを始めてみては？", 1, 1.4, "士条 怜", 0, 0, 0, 0, 1, 0, 2, "少しは磨かれると思いますよ。", 1003, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("今日はなにして遊ぶ？", "ねぇ、にいちゃん！", 1, 1.5, "穂高 みそぎ", 0, 0, 0, 0, 1, 0, 2, "みそぎはねぇ、\nかくれんぼやりたい！", 1004, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("ねぇ…", "風宮あかりです", 1, 1.4, "風宮 あかり", 0, 0, 0, 0, 1, 0, 2, "私といっしょに…\nいかない？", 1006, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("プリンたべたいのー", "出雲宮子なのー", 1, 1.5, "出雲 宮子", 0, 0, 0, 0, 1, 0, 2, "食べ物の恨みは怖いのー", 1007, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("キミもボクの美貌に\n吸い寄せられたんだね。", "ボクは虹村雪。", 1, 1.4, "虹村 雪", 0, 0, 0, 0, 1, 0, 2, "いいよ。\n見られることは運命さ…", 1008, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "フッ…聞いて後悔するがいい！", 1, 1.4, "柊杏奈", 0, 0, 0, 0, 1, 0, 2, "人呼んで「疾風の冥姫」!!", 1009, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("うさぎさん、\n運命の王子はんに巡りあわせてくれて", "マホマホ王国のプリンセス、\nまほ姫どす", 1, 1.5, "姫宮 真歩", 0, 0, 0, 0, 1, 0, 2, "ほんまおおきにやわ～♪", 1010, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("生き別れたお兄ちゃんを探して\n三千世界！", "衣之咲璃乃です！", 1, 1.4, "衣之咲 璃乃", 0, 0, 0, 0, 1, 0, 2, "ここで会ったが\n100年目～！", 1011, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("ち、超能力って…\n何のことかな～？", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 1.4, "柏崎 初音", 0, 0, 0, 0, 1, 0, 2, "…って、お願い！\n誰にも言わないでおいて～！", 1012, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("一応カリスマ読モJKやってまっす！", "ちょす！\n美波鈴奈だよ～♪", 1, 1.4, "美波 鈴奈", 0, 0, 0, 0, 1, 0, 2, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1016, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("東京は遊園地みたいなところさー", "はいたーい。\n喜屋武香織さー。", 1, 1.4, "喜屋武 香織", 0, 0, 0, 0, 1, 0, 2, "でも、沖縄もとってもいいとこさー", 1017, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("先生って呼ばれるのは\nくすぐったいから", "支倉伊緒です。", 1, 1.4, "支倉 伊緒", 0, 0, 0, 0, 1, 0, 2, "イオちゃんって呼んでね。", 1018, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("あ！/\お兄ちゃ～ん\nまってよ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 1.5, "茜 ミミ", 0, 0, 0, 0, 1, 0, 2, "ミミをおいてかないでぇ～", 1020, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("あの……\nふぇ……", "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 1.5, "栗林 くるみ", 0, 0, 0, 0, 1, 0, 2, "ふぇぇぇぇぇん……", 1021, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("こんな私に貴重な時間を\n割いていただき、", "風宮よりです。\nあああああ！", 1, 1.4, "風宮 より", 0, 0, 0, 0, 1, 0, 2, "なんてありがとうございます！", 1022, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("おにいちゃんどこいくの？\nえ？", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 1.5, "北条 綾音", 0, 0, 0, 0, 1, 0, 2, "私こっち行きたいー\nね、早く早くー", 1023, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("ふ、不束者ですが\nどうぞ末永く…って、", "わっ…わっ…私、\n天野すずめといいます！", 1, 1.4, "天野 すずめ", 0, 0, 0, 0, 1, 0, 2, "これて何か違う…\nあああすみません！", 1025, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("あなたは…運命の……\n伴侶……", "……クスクス…私は\n…倉石恵理子……", 1, 1.4, "倉石 恵理子", 0, 0, 0, 0, 1, 0, 2, "離しませんわ………\n絶対に…!!", 1027, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 1.4, "佐々木 咲恋", 0, 0, 0, 0, 1, 0, 2, "…そうでしょ？？", 1028, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("ぇっと…\nキミ、私のこと知らないの?!", "桜井望だよ！\nよろしくねっ", 1, 1.4, "桜井 望", 0, 0, 0, 0, 1, 0, 2, "あはは、\n私もまだまだだなぁ～", 1029, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("初めまして、\n私はニノン・ジュベール申すデス！", "デケデケデンっ！", 1, 1.4, "ニノン・ジュベール", 0, 0, 0, 0, 1, 0, 2, "ショーグン、\nワタシと一緒に天下統一デース！", 1030, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("でもって私の隣にいるのが……\nえ、見えない？", "上喜しのぶです。\n手元のドクロが父です。", 1, 1.4, "上喜 しのぶ", 0, 0, 0, 0, 1, 0, 2, "おかしいですね……", 1031, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("けんども\nそれには足りないモンが…", "目指すはビッグな\nお笑い芸人だっぺ！", 1, 1.5, "野戸まひる", 0, 0, 0, 0, 1, 0, 2, "そう、\nオラのボケに突っ込める相方が…！", 1033, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("ちょっと緊張しちゃって…", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 1.4, "綾瀬 ゆかり", 0, 0, 0, 0, 1, 0, 2, "ちょ\nちょっと一杯飲んできます…！", 1034, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("知らない人とは話しちゃいけないので", "氷川鏡華…です", 1, 1.5, "氷川 鏡華", 0, 0, 0, 0, 1, 0, 2, "これ以上お話しすることは…\nないです！", 1036, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("……あ、アラーム。", "柏崎…栞です。", 1, 1.4, "柏崎 栞", 0, 0, 0, 0, 1, 0, 2, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1038, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("私、一人も友達がいなくて……", "ふ、双葉碧です。", 1, 1.4, "双葉 碧", 0, 0, 0, 0, 1, 0, 2, "野に咲く花が、\n唯一の話相手です。", 1040, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "三角千歌です。", 1, 1.4, "三角 千歌", 0, 0, 0, 0, 1, 0, 2, "そう思っています。", 1042, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("あぁ？\nお前のそいつの仲間か？", "安芸真琴だ。", 1, 1.4, "安芸 真琴", 0, 0, 0, 0, 1, 0, 2, "う、疑ってすまなかったな…", 1043, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("生けとし生ける全ての者よ！", "わらわこそは夜を総べる者！", 1, 1.4, "イリヤ・オーンスタイン", 0, 0, 0, 0, 1, 0, 2, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1044, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("ぐふふふふ……はっ！", "そこで騎士は妖精を乱暴に……", 1, 1.4, "遠見 空花", 0, 0, 0, 0, 1, 0, 2, "ｌク、クウカに何かご用ですか!?", 1045, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("自由気ままで♪\n寝て遊んで、食べてケンカして…", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 1.4, "宮坂たまき", 0, 0, 0, 0, 1, 0, 2, "う～ん…\n猫ってホントに最高にゃ～♪", 1046, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("それでは早速クエストに…", "大神美冬よ！", 1, 1.4, "大神 美冬", 0, 0, 0, 0, 1, 0, 2, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1048, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("クエストもバトルも\n掃除も洗濯も", "星野静流だよ！", 1, 1.4, "星野静流", 0, 0, 0, 0, 1, 0, 2, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1049, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("見ての通りの\nセクシー美少女で", "アタシは玉泉美咲。", 1, 1.5, "玉泉美咲", 0, 0, 0, 0, 1, 0, 2, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1050, 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES ("？？？？", "？？？", 1, 1.4, "リマ", 0, 0, 0, 0, 1, 0, 2, "？？？？", 1052, 1);
